import React, { useRef, useState, useEffect } from 'react';
import * as tf from '@tensorflow/tfjs';
import * as posedetection from '@tensorflow-models/pose-detection';
import { ChairSquatTracker } from '../exercises/ChairSquats';

const ExercisePage = () => {
  const videoRef = useRef(null);
  const canvasRef = useRef(null);
  const detectorRef = useRef(null);
  const trackerRef = useRef(new ChairSquatTracker());

  const [repCount, setRepCount] = useState(0);
  const [feedback, setFeedback] = useState('Click Start to begin');
  const [isScanning, setIsScanning] = useState(false);

  // Draw keypoints on canvas
  const drawKeypoints = (pose) => {
    if (!canvasRef.current || !pose) return;

    const ctx = canvasRef.current.getContext('2d');
    ctx.clearRect(0, 0, canvasRef.current.width, canvasRef.current.height);

    // Draw keypoints
    pose.keypoints.forEach((kp) => {
      if (kp.score > 0.3) {
        ctx.beginPath();
        ctx.arc(kp.x, kp.y, 5, 0, 2 * Math.PI);
        ctx.fillStyle = 'red';
        ctx.fill();
      }
    });
  };

  useEffect(() => {
    // Initialize TensorFlow
    tf.setBackend('webgl');

    return () => {
      stopDetection();
    };
  }, []);

  const startDetection = async () => {
    try {
      setIsScanning(true);
      setFeedback('Initializing camera...');

      // Get camera stream
      const stream = await navigator.mediaDevices.getUserMedia({
        video: { width: 640, height: 480, facingMode: 'user' }
      });
      videoRef.current.srcObject = stream;

      // Wait for video to be ready
      await new Promise((resolve) => {
        videoRef.current.onloadedmetadata = resolve;
      });
      await videoRef.current.play();

      setFeedback('Loading pose detector...');

      // Initialize pose detector
      detectorRef.current = await posedetection.createDetector(
        posedetection.SupportedModels.MoveNet,
        { modelType: posedetection.movenet.modelType.SINGLEPOSE_LIGHTNING }
      );

      // Reset counters
      trackerRef.current.reset();
      setRepCount(0);
      setFeedback('Ready - start squatting!');

      // Start detection loop
      detectPoses();
    } catch (err) {
      console.error("Error:", err);
      setFeedback(`Error: ${err.message}`);
      setIsScanning(false);
    }
  };

  const detectPoses = async () => {
    if (!isScanning || !detectorRef.current) return;

    try {
      const poses = await detectorRef.current.estimatePoses(videoRef.current);

      if (poses && poses.length > 0) {
        drawKeypoints(poses[0]);
        const result = trackerRef.current.process(poses[0].keypoints);
        setRepCount(result.reps);
        setFeedback(result.feedback);
      }
    } catch (err) {
      console.error("Detection error:", err);
    }

    requestAnimationFrame(detectPoses);
  };

  const stopDetection = () => {
    setIsScanning(false);
    if (videoRef.current?.srcObject) {
      videoRef.current.srcObject.getTracks().forEach(track => track.stop());
    }
    setFeedback('Detection stopped');
  };

  return (
    <div style={{ padding: '20px', fontFamily: 'Arial' }}>
      <h1>Chair Squat Tracker</h1>

      <div style={{
        position: 'relative',
        width: '640px',
        height: '480px',
        margin: '0 auto',
        border: '2px solid #333'
      }}>
        <video
          ref={videoRef}
          width="640"
          height="480"
          playsInline
          muted
          style={{
            position: 'absolute',
            top: 0,
            left: 0,
            transform: 'scaleX(-1)'
          }}
        />
        <canvas
          ref={canvasRef}
          width="640"
          height="480"
          style={{
            position: 'absolute',
            top: 0,
            left: 0
          }}
        />
      </div>

      <div style={{
        margin: '20px auto',
        textAlign: 'center',
        maxWidth: '640px'
      }}>
        <p style={{ fontSize: '18px', fontWeight: 'bold' }}>Reps: {repCount}</p>
        <p style={{ fontSize: '16px', minHeight: '24px' }}>{feedback}</p>

        <div style={{ marginTop: '20px' }}>
          <button
            onClick={startDetection}
            disabled={isScanning}
            style={{
              padding: '10px 20px',
              margin: '0 10px',
              fontSize: '16px',
              backgroundColor: isScanning ? '#cccccc' : '#4CAF50',
              color: 'white',
              border: 'none',
              borderRadius: '4px',
              cursor: 'pointer'
            }}
          >
            Start
          </button>
          <button
            onClick={stopDetection}
            disabled={!isScanning}
            style={{
              padding: '10px 20px',
              margin: '0 10px',
              fontSize: '16px',
              backgroundColor: !isScanning ? '#cccccc' : '#f44336',
              color: 'white',
              border: 'none',
              borderRadius: '4px',
              cursor: 'pointer'
            }}
          >
            Stop
          </button>
        </div>
      </div>
    </div>
  );
};

export default ExercisePage;
